import { FlyControls } from 'https://unpkg.com/three@0.126.1/examples/jsm/controls/FlyControls.js';

const scene = new THREE.Scene();
const camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);
const renderer = new THREE.WebGLRenderer();

renderer.setSize(window.innerWidth, window.innerHeight);
renderer.setPixelRatio(devicePixelRatio);
document.body.appendChild(renderer.domElement);
camera.position.set(0, 0, 0);

var controls = new FlyControls( camera, renderer.domElement );
controls.movementSpeed = 40;
controls.rollSpeed = Math.PI / 3;
controls.autoForward = false;
controls.dragToLook = true;

var light = new THREE.AmbientLight(0xffffff);
light.position.set(0, 0, 0);
scene.add(light);

function animate() {
    requestAnimationFrame(animate);

    controls.update(0.01);
    renderer.render(scene, camera);
}

function generate(json) {
    const defaultTexture = new THREE.TextureLoader().load( './img/default.png', function ( texture ) {

    texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
    texture.offset.set( 0, 0 );
    texture.repeat.set( 2, 2 );

} );
    const grabbableTexture = new THREE.TextureLoader().load( './img/grabbable.png', function ( texture ) {

    texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
    texture.offset.set( 0, 0 );
    texture.repeat.set( 2, 2 );

} );
    const iceTexture = new THREE.TextureLoader().load( './img/ice.png', function ( texture ) {

    texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
    texture.offset.set( 0, 0 );
    texture.repeat.set( 2, 2 );

} );
    const lavaTexture = new THREE.TextureLoader().load( './img/lava.png', function ( texture ) {

    texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
    texture.offset.set( 0, 0 );
    texture.repeat.set( 2, 2 );

} );
    const woodTexture = new THREE.TextureLoader().load( './img/wood.png', function ( texture ) {

    texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
    texture.offset.set( 0, 0 );
    texture.repeat.set( 2, 2 );

} );
    const grappleableTexture = new THREE.TextureLoader().load( './img/grappleable.png', function ( texture ) {

    texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
    texture.offset.set( 0, 0 );
    texture.repeat.set( 2, 2 );

} );
    const grappleable_lavaTexture = new THREE.TextureLoader().load( './img/grappleable_lava.png', function ( texture ) {

    texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
    texture.offset.set( 0, 0 );
    texture.repeat.set( 2, 2 );

} );
    const grabbable_crumblingTexture = new THREE.TextureLoader().load( './img/grabbable_crumbling.png', function ( texture ) {

    texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
    texture.offset.set( 0, 0 );
    texture.repeat.set( 2, 2 );

} );
    const default_colorTexture = new THREE.Texture( 'default_color.png', function ( texture ) {

    texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
    texture.offset.set( 0, 0 );
    texture.repeat.set( 2, 2 );

} );

    var start = data.start;
    camera.position.set(start.position[0], start.position[1] + 1, start.position[2]);
    var nodes = json.nodes;
    for (var i = 0; i < nodes.length; i++) {
        var node = nodes[i];
        if (node.type == 'default') {
          var material = new THREE.MeshBasicMaterial({ map: defaultTexture });
        } else if (node.type == 'grabbable') {
          var material = new THREE.MeshBasicMaterial({ map: grabbableTexture });
        } else if (node.type == 'ice') {
          var material = new THREE.MeshBasicMaterial({ map: iceTexture });
        } else if (node.type == 'lava') {
          var material = new THREE.MeshBasicMaterial({ map: lavaTexture });
        } else if (node.type == 'wood') {
          var material = new THREE.MeshBasicMaterial({ map: woodTexture });
        } else if (node.type == 'grappleable') {
          var material = new THREE.MeshBasicMaterial({ map: grappleableTexture });
        } else if (node.type == 'grappleable_lava') {
          var material = new THREE.MeshBasicMaterial({ map: grappleable_lavaTexture });
        } else if (node.type == 'grabbable_crumbling') {
          var material = new THREE.MeshBasicMaterial({ map: grabbable_crumblingTexture });
        } else if (node.type == 'default_color') {
          var material = new THREE.MeshBasicMaterial({ map: default_colorTexture });
        }

        if (node.shape == "cube") {
          var geometry = new THREE.BoxGeometry(node.scale[0], node.scale[1], node.scale[2]);
        } else if (node.shape == "sphere") {
          var geometry = new THREE.SphereGeometry(node.scale[0], node.scale[1], node.scale[2]);
        } else if (node.shape == "cylinder") {
          var geometry = new THREE.CylinderGeometry(node.scale[0], node.scale[1], node.scale[2], node.scale[3]);
        } else if (node.shape == "pyramid") {
          var geometry = new THREE.CylinderGeometry(node.scale[0], node.scale[1], node.scale[2], node.scale[3]);
        } else if (node.shape == "prism") {
          var geometry = new THREE.TetrahedronGeometry(node.scale[0], node.scale[1], node.scale[2], node.scale[3]);
        } else if (node.shape == "sign") {
          var geometry = new THREE.BoxGeometry(node.scale[0], node.scale[1], node.scale[2]);
        }
        var obj = new THREE.Mesh(geometry, material);
        obj.position.set(node.position[0], node.position[1], node.position[2]);
        scene.add(obj);
    }
}

